URL

Passes the specified URL to the next action.

```js
URL({
  url: 'https://shortcuts.fun',
});
```

URL

Encodes or decodes text passed into the action to be suitable for inclusion in a URL by adding or removing percent escapes when appropriate.

```js
URLEncode({
  encodeMode: 'Encode',
});
```

Variable

Appends this action's input to the specified variable, creating the variable if it does not exist. This allows you to make a variable hold multiple items.

```js
// Append the input to the variable named 'My Var'
addToVariable({
  variable: variable('My Var'),
});
```

Scripting

Displays a dialog prompting the user to enter a piece of information.

```js
// Ask for favourite colour, defaulting to pink
ask({
  defaultAnswer: 'Pink',
  question: 'What is your favourite colour?',
});
```

Scripting

Encodes or decodes text or files using Base64 encoding.

```js
base64Encode({
  encodeMode: 'Encode',
  lineBreakMode: 'Every 76 Characters',
});
```

Calculator

Performs a number operation on the input and returns the result.

```js
// Divide the input by 7
calculate({
  operand: 7,
  operation: '/',
});
```

Calculator

Calculates statistics on the numbers that are provided as input.

```js
calculateStatistics({
  operation: 'Average',
});
```

Scripting

Presents a menu and runs different actions based on which menu item was chosen.

```js
chooseFromMenu({
  items: [{
    label: 'Blue',
    // An array of actions to perform if 'blue' is selected
    actions: [],
  }, {
    label: 'Green',
    // An array of actions to perform if 'green' is selected
    actions: [],
  }],
  prompt: 'Which of these is your favourite colour?',
});
```

Text

This action lets you explain how part of a shortcut works. When run, this action does nothing.

```js
// Create a comment
comment({
  text: 'A very important comment',
});
```

Scripting

Tests if any item passed as input matches the specified condition, and if so, runs the actions inside. Otherwise, the actions under “Otherwise” are run.

```js
conditional({
  ifTrue: [
    comment({
      text: 'Do something when true',
    }),
  ],
  ifFalse: [
    comment({
      text: 'Do something different when false',
    }),
  ],
  input: '<',
  value: 27,
});
```

Calculator

Counts the number of items, characters, words, sentences, or lines passed as input.

```js
count({
  // Count the number of lines in the input
  type: 'Lines',
});
```

Clock

Creates an alarm in the Clock app.

```js
createAlarm({
  label: 'Alarm',
  time: '8 AM',
  repeat: ['Sunday', 'Saturday'],
});
```

Date

Passes the specified date and time to the next action.

```js
date({
  use: 'Specified Date',
  date: 'Tomorrow',
});
```

Scripting

Passes the specified list of key-value pairs to the next action as a dictionary

```js
// Create a dictionary
dictionary({
  value: {
    hello: 'world!',
    myNum: 7,
    myArray: ['a', 'b', 'c', 'etc'],
    myObj: {
      anotherString: 'How deep does this thing go?',
    }
  },
});
```

Scripting

Generates a MD5/SHA1 hash from the input.

```js
generateHash({
  type: 'MD5',
});
```

Downloads

Gets the contents of URLs passed into the action. Useful for downloading files and web content, or for making API requests.

```js
getContentsOfURL({
  headers: {
    'Authorization': 'Pretty please',
    'X-Some-Header': 'Badger',
  },
  method: 'POST',
  requestBodyType: 'JSON',
  requestBody: {
    myObj: {
      things: [1, 2, 3],
      someString: 'Hello',
    },
    someOtherString: 'World!',
  },
});
```

Network

Returns the local or external IP address of the device.

```js
getCurrentIPAddress({
  address: 'External',
  type: 'IPv4',
});
```

Scripting

Gets information about the current device.

```js
getDeviceDetails({
  detail: 'Device Name',
});
```

Scripting

Gets the value for the specified key in the dictionary passed into the action.

```js
getDictionaryValue({
  get: 'Value',
  key: 'My Key',
});
```

Bursts

Gets the most recent burst photos from the camera roll.

```js
getLatestBursts({
  count: 20,
});
```

LivePhotos

Gets the most recent Live Photos from the camera roll.

```js
getLatestLivePhotos({
  count: 1,
});
```

Photos

Gets the most recent screenshots from the camera roll.

```js
getLatestScreenshots({
  count: 1,
});
```

Photos

Gets the most recent videos from the camera roll.

```js
getLatestVideos({
  count: 1,
});
```

Wi-Fi

Gets information about the currently connected networks.

```js
getNetworkDetails({
  network: 'Wi-Fi',
  get: 'Network Name',
});

getNetworkDetails({
  network: 'Cellular',
  get: 'Carrier Name',
});
```

Date

Subtracts the specified date from the date passed into the action. For example, this action could get the number of minutes from now until a calendar event passed in as input.

```js
getTimeBetweenDates({
  unit: 'Days',
  date: '3/5/2011 5:45pm',
});
```

Variable

Gets the value of the specified variable and passes it to the next action.

```js
getVariable({
  variable: variable('My Variable'),
});
```

Scripting

Allows you to specify a list of items to be passed to the next action.

```js
// Create a list
list({
  value: [
    'a',
    'b',
    'c',
    '123',
  ],
});
```

Documents

Makes an archive out of the files passed as input. Supports creating zip, tar.gz, tar.bz2, tar, gzip, cpio, or iso archives.

```js
makeArchive({
  format: '.zip',
  name: 'zipName',
});
```

Text

Searches text passed into the action for matches to a regular expression.

```js
matchText({
  pattern: '[0-9a-zA-Z]',
  caseSensitive: false,
});
```

Calculator

Passes a number to the next action.

```js
number({
  number: 7,
});
```

Apps

Opens the specified app.

```js
openApp({
  appId: 'com.christianselig.Apollo'
});
```

Instagram

Opens the photo passed into this action in the Instagram app and copies the caption to the clipboard.

```js
postOnInstagram({
 caption: 'My caption',
});
```

Pythonista

Opens the specified script in Pythonista for editing.

```js
editScript({
  script: 'MyScript.py',
});
```

Pythonista

Runs the specified script in Pythonista and waits to continue the shortcut until you return to the Shortcuts app.

```js
runScript({
  script: 'MyScript.py',
});
```

Calculator

Passes a random number between the given minimum and maximum to the next action. The minimum and maximum numbers are included as possible results.

```js
randomNumber({
  minimum: 0,
  maximum: 100,
});
```

Safari

Runs JavaScript on a Safari web page passed in as input

```js
runJavaScriptOnWebPage({
  text: '
  var result = [];
  // Get all links from the page
  var elements = document.querySelectorAll("a");
  for (let element of elements) {
    result.push({
      "url": element.href,
      "text": element.innerText
    });
  }

  // Call completion to finish
  completion(result);
  `,
});
```

Shortcuts

Run a shortcut from your shortcut.

```js
runShortcut({
  name: 'My Great Shortcut',
  show: true,
});
```

AirplaneMode

Sets the device’s Airplane Mode to on or off.

```js
setAirplaneMode({
  value: true,
});
```

Bluetooth

Sets the device’s Bluetooth to on or off.

```js
setBluetooth({
  value: true,
});
```

Brightness

Sets the device brightness.

```js
setBrightness({
  brightness: 75,
});
```

CellularData

Sets the device’s Cellular Data to on or off.

```js
setCellularData({
  value: true,
});
```

Scripting

Sets a value in the dictionary passed into the action.

```js
setDictionaryValue({
  key: 'testKey',
  value: 'testValue',
});
```

DoNotDisturb

Sets the device’s Do Not Disturb to on or off

```js
setDoNotDisturb({
  value: true,
  until: 'Time',
  time: '08:00',
  event: '',
});
```

Battery

Sets the device’s Low Power Mode to on or off.

```js
setLowPowerMode({
  value: false,
});
```

Scripting

Sets the name of the item passed as input.

```js
setName({
  name: 'Test',
  dontIncludeFileExtension: true,
});
```

Flashlight

Turns on or off the flashlight near the device's camera.

```js
setTorch({
  setting: 'Off',
});
```

Variable

Sets the value of the specified variable to the input of this action.

```js
setVariable({
  variable: variable('My Variable'),
});
```

Sound

Sets the system volume.

```js
 setVolume({
   volume: 50,
});
```

Wi-Fi

Sets the device’s Wi-Fi to on or off.

```js
setWiFi({
  value: true,
});
```

Scripting

Displays an alert with a title, a message, and two buttons. If the user selects the OK button, the shortcut continues. The cancel button stops the shortcut.

```js
showAlert({
  title: 'Alert',
  message: 'Do you want to continue?',
  showCancelButton: true,
});
```

Maps

Opens your choice of Maps, Google Maps, or Waze and searches for the location, place, or text that was passed into the action.

```js
showInMaps({
 app: 'Google Maps',
});
```

Notification

Displays a local notification.

```js
showNotification({
 title: 'Hello, World!',
 body: 'This is a test notification',
 sound: true,
});
```

Scripting

Shows the specified text in Siri or in an alert.

```js
showResult({
  text: 'Hello, world!',
});
```

Rewind

Skips to the previous song in the current music queue.

```js
 skipBack({
 	skipBackBehavior: 'Beginning',
 });
```

Text

Passes the specified text to the next action.

```js
text({
  text: 'Some lovely text!',
});
```

Scripting

Waits for the specified number of seconds before continuing with the next action.

```js
wait({
  time: 19,
});
```

